text:
Хватит болтовни! Нужны реальные действия со стороны России. Что мы должны сделать до конца сентября:
1)  На законодательном уровне ОТМЕНИТЬ все признания вражеских государств: начиная с Украины и заканчивая Омерикой;
2) Все непризнанные, дружественные нам страны ПРИЗНАТЬ;
3) Разослать всем малым странам приглашение войти в состав Великой России и при юридическом согласии, принять в состав РФ. Таких государств, которые сейчас находятся под омерикано-европейскими блокадами и гнётом, будет ОЧЕНЬ много;
4) Всех омерикано-польско-украинских заробитчан и горе-политологов депортировать из России.
Для начала будет достаточно!  И сразу увидите: как изменится мир и как враги России взвоют от мощи Российской Империи.
